COPY public.labo_article (id, titre, contenu, image_principale, date_creation, date_modification, est_publie, auteur_id) FROM stdin;
3	How you brain performs under stress and some fixes	<h1>&nbsp;How Your Brain Performs Under Stress – and Simple Fixes to Regain Control</h1><div><i>By Franck Feuwo, Computer Scientist | English Friday at Beta Lab</i></div><div><br></div><div>As a computer scientist, I spend a lot of time solving technical problems. But over the years, I’ve become just as fascinated with the human brain and the invisible processes that shape how we think, feel, and function especially under pressure.</div><div>Here’s a recap of what I shared on stage, and why I believe this message is more important than ever.</div><div><br></div><h2>What Really Happens in the Brain When We're Stressed?</h2><div>When you're stressed, there's an internal system that kicks into gear automatically. It's not always helpful. In fact, it often works against us. Let me break it down:</div><div><br></div><div>The <b>Amygdala</b> is like your brain’s alarm system. It’s responsible for detecting threats. The issue is it often can’t tell the difference between a real emergency and an uncomfortable email.</div><div><br></div><div>The <b>Hypothalamus</b> acts like the command center. Once the alarm goes off, this part of your brain sends signals to your body to go into fight-or-flight mode. It’s efficient, but it can flood your system with stress hormones.</div><div><br></div><div>The <b>Prefrontal Cortex i</b>s your rational thinker. It helps you plan, make decisions, and think critically. But when you’re stressed, this part gets overwhelmed and starts to shut down—just when you need it most.</div><div><br></div><h2>How Stress Shows Up&nbsp;</h2><div>There is plenty ways how stress show up.&nbsp; It shows up emotionally, mentally, and even physically. Some common symptoms include:</div><div><br></div><div><b>Tunnel Vision </b>– You get stuck on one problem and can’t see the bigger picture.</div><div><b>Memory Lapses</b> – Ever walk into a room and forget why you went in? That’s stress messing with your brain.</div><div><b>Overreactions</b> – Small issues suddenly feel like the end of the world.</div><div><br></div><div><i><b>Sound familiar?</b></i></div><div><br></div><h2>&nbsp;So What Can We Do About It?</h2><div><br></div><div>One thing I really wanted to emphasize in my talk is that stress itself isn’t the enemy. It’s our response to stress that determines how we experience it. Over time, There are  four simple but powerful habits to manage stress and take back control:</div><div><br></div><div><b>Breathe Deeply</b> – It’s simple but powerful. Deep, conscious breathing signals safety to your brain and calms your nervous system.</div><div><b>Reframe the Stress</b> – Change how you interpret the situation. Instead of seeing stress as a threat, see it as a challenge. This shift in mindset changes everything.</div><div><b>Move Your Body</b> – Whether it’s a walk, a stretch, or a full workout—movement helps reset your brain and release tension.</div><div><b>Connect With Others</b> – One of the most underrated tools for emotional regulation is simply talking to someone. Connection is healing.</div><div><br></div><h2>&nbsp;What I Want You to Remember</h2><div><b style="">If you take away one thing from my  talk, let it be this:</b></div><div><br></div><div><b><i>Stress is not the problem. Our response to stress is what makes all the difference.</i></b></div><div>—</div><div><br></div><div>I hope this message resonates with you, whether you’re a student, professional, or fellow researcher</div><div>Let’s keep the conversation going.</div><div><br></div><div><i>Franck Feuwo</i></div><div><i>Computer Scientist&nbsp;</i></div><div><br></div><div><br></div>	articles/images/tedtalk1.png	2025-05-14 15:42:24.724964+01	2025-05-14 15:50:25.070984+01	t	5
\.


